let transactionID = 0x1f;
let vLeds = 
[
	{ Name:"Scroll Wheel", Position:[0, 0] },
	{ Name:"Logo", Position:[0, 2] },
	{ Name:"Side Panel", Position:[1, 1] }
];

export function LedNames()
{
	let return_value = [];

	for(let i=0; i < vLeds.length; i++)
	{
		return_value.push(vLeds[i].Name);
	}

	return return_value;
}

export function LedPositions()
{
	let return_value = [];

	for(let i=0; i < vLeds.length; i++)
	{
		return_value.push(vLeds[i].Position);
	}

	return return_value;
}

export function Initialize()
{
	device.set_endpoint(0,0x0002,0x0001);

	getDeviceMode();
	getDeviceFirmwareVersion();
	getDeviceSerial();

	if(DpiControl)
	{
		DPIStageControl();
	}

	setDevicePollingRate();
}

export function Render()
{
	setDeviceColor(0);
	setDeviceColor(1);
	setDeviceColor(2);
	setDeviceColor(3);
	detectInputs();
}

